  "text" : "\uD559\uBC8C\uC740 \uC810\uC218, \uD569\uACA9, \uCD9C\uC138\uC758 \uD45C\uD604\uC774 \uC544\uB2C8\uB2E4. \uD559\uBC8C\uC740 \uD3EC\uBD80\uC640 \uB864\uBAA8\uB378, \uC815\uBCF4\uC758 \uC5EC\uBD80\uB2E4. \u201C\uC0C1\uC0C1\uD560 \uC218 \uC788\uB0D0\u201D \uC120\uC5D0\uC11C \uAC08\uB77C\uBC84\uB9AC\uB294\uAC83. \uB85C\uC2A4\uCFE8\uC744 \uC0AC\uC2DC\uBCF4\uACE0 \uAC00\uB294\uC904 \uC544\uB294 \uACE0\uC878\uCE5C\uAD6C\uB3C4 \uC788\uACE0, \uC5B4\uB290 \uD559\uAD50\uC5D0\uC11C\uB098 \uBBFC\uC871\uC8FC\uC758\uC790\uC640 \uB9D1\uC2A4\uC8FC\uC758\uC790\uAC00 \uB2F4\uB860\uD22C\uC7C1\uD558\uB294 \uC904 \uC544\uB294 \uD799\uC2A4\uD130\uB3C4 \uC788\uB2E4.",
